const socket = io.connect("http://localhost:3001");
socket.emit('message','hello from client')
socket.on("server-message", (data)=>{
  console.log(data)
});

function App() {
  return (
    <>
      <Router>
        <Routes>
          <Route path={"/"} element={<Register />} />
          <Route path={"/chat"} element={<PublicChat />} />

          {/* <Route path={"/chat"} element={<PublicChat 
          // socket={socket} 
          />} /> */}
        </Routes>
      </Router>
    </>
  );
}

export default App;
